import React from 'react';
import './Carusel.css';

export default function Carusel(){
    return (
        <div className='life_style'>
            <div className='about_lifestyle'>
                <h2 id='headLifeStyle'>מה זה לייף סטייל?</h2>
            </div>
            <div className='textLifeStyle'></div>
        </div>
    )
  };
